import React from 'react'

const App = (props) => {
  const { notes } = props

  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {notes.map((x, i) =>
          <li key={i}>
            {x.content}
          </li>
        )}
      </ul>
    </div>
  )
}

export default App
